      "story": "Once a horse met an elephant, and then they saw a ball in a pool. The horse tried to swim and get the ball, and then the elephant gave him the ball. The horse was wet, and the elephant was holding the ball. The end."
    },
    {
      "story_id": "2",
      "start_time": "2023-05-07T09:05:00",
      "end_time": "2023-05-07T09:08:00",
      "story": "Once a horse saw that I just talked about, but the ball was not in there. The elephant wanted to go in, but he hurt his knee cap. The horse helped him, and then there was another elephant who was a lifeguard. They are doing something. I think they are battling. Then they sat on the bench, and the lifeguard was mad. The end."
    },
    {
      "story_id": "3",
      "start_time": "2023-05-07T09:10:00",
      "end_time": "2023-05-07T09:12:30",
      "story": "Once, the horse and the elephant were happy near the swimming pool. The horse had an airplane to play with, which had something coming down at the bottom. The elephant tried it, and the horse was mad. The lifeguard tried to get it but he could not. The horse cried, and then an elephant with a net came and caught it. She gave it back to the horse, and then the horse loved it. The end."
    },
    {
      "story_id": "4",
      "start_time": "2023-05-07T09:15:00",
      "end_time": "2023-05-07T09:17:00",
      "story": "Once two rabbits made a sandcastle. It was a great one. One took some sand from a pail, and the other one took some sand, and he dumped it on the castle. Part of it stayed the way it was, but the rest turned into just a lump. The end."
    }
  ]
